import React from 'react';
import Paginator from '../common/Paginator/Paginator';
import User from './User'

type PropsType = {
    totalUsersCount: number
    pageSize: number 
    currentPage: number
    onPageChanged: (pageNumber: number) => void
    users: number
}

const Users: React.FC<PropsType> = ({ onPageChanged, currentPage, users, totalUsersCount, pageSize, ...props }) => {
    console.log(props);

    return (
        <div>
            <Paginator onPageChanged={onPageChanged} currentPage={currentPage} totalItemsCount={totalUsersCount} pageSize={pageSize} />
            <div>
                {usersPage.map((u) => <User user={u} key={u.id} followingInProgress={props.followingInProgress} unfollow={props.unfollow} follow={props.follow} />)}
            </div>
        </div>
    )
}

export default Users
